import React, { useState } from 'react';

import IdintetyList from './IdintetyList';
import classes from './GetAllUsers.module.css';

const MyProfile = () => {
  const [idintety, setIdintety] = useState([]);
  const url = 'http://localhost:3001/identefier';

  const getDataHandeler = async () => {
    fetch(url)
      .then((res) => res.json())
      .then((data) => {
        setIdintety(data);
      });
    console.log(idintety);
  };
  const deleteHandeler = (id) => {
    const userId = idintety.filter((inf) => inf._id !== id);
    setIdintety(userId);
  };
  return (
    <section className={classes.box}>
      <div className={classes.actions}>
        <button onClick={getDataHandeler}>Get Your Data</button>
      </div>
      <IdintetyList idintetyInfo={idintety} onDelete={deleteHandeler} />
    </section>
  );
};

export default MyProfile;
